  /*INIT PHASE*/

  /*OPTIONS and  js variables*/
  let defaults = { width: "300px", height: "400px", fontSize: "1em", mode: "default", category: "Smileys & emotion", banner: "<span>📗&nbsp;Emojis: Ultimate Compendium&nbsp;📗</span>" }
  this.options = { ...defaults, ...options }
